    @Test
    public void test7() {
        Tensor t = Tensors.parse("k_i/(k_i*k^i-m**2)+p_i/(k_i*k^i-m**2)");
        Tensor expected = Tensors.parse("(p_i+k_i)/(k_i*k^i-m**2)");
        TAssert.assertEquals(expected, Together.together(t));
    }

    @Test
    public void test8() {
        Tensor t = Tensors.parse("k_i*k_j/(k_i*k^i-m**2)+p_i*k_j/(k_i*k^i-m**2)");
        Tensor expected = Tensors.parse("(p_i*k_j+k_i*k_j)/(k_i*k^i-m**2)");
        TAssert.assertEquals(expected, Together.together(t));
    }

